--
-- Name: lastaction(); Type: FUNCTION; Schema: public; Owner: dev
--

CREATE FUNCTION lastaction() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN

	UPDATE claims set last_action_id = NEW.ID where ID = NEW.ClaimID;

END;
$$;


ALTER FUNCTION public.lastaction() OWNER TO dev;

--
-- Name: reset_last_action(); Type: FUNCTION; Schema: public; Owner: dev
--

CREATE FUNCTION reset_last_action() RETURNS boolean
    LANGUAGE plpgsql STRICT
    AS $$
BEGIN
	update claims set last_action_id = (select max(tasks.id) as mid from tasks  where tasks.claim_id = claims.id);
END;
$$;


ALTER FUNCTION public.reset_last_action() OWNER TO dev;

