--
-- Name: claims_requiring_followup; Type: VIEW; Schema: public; Owner: dev
--

CREATE VIEW claims_requiring_followup AS
    SELECT patients.patient_first_name, patients.patient_last_name, patients.patient_birth_date, claims.id AS claim_id, claims.first_claim_date, claims.balance_due, at.action_name, fault_types.fault_name, users.user_name, contact_types.contact_type_name, tasks.comments, tasks.contact_date, tasks.expected_writeoff, tasks.expected_payment, payers.payer_name FROM (((((((claims LEFT JOIN patients ON ((claims.patient_id = patients.id))) LEFT JOIN tasks ON ((claims.last_action_id = tasks.id))) LEFT JOIN action_types at ON ((tasks.action_type_id = at.id))) LEFT JOIN fault_types ON ((tasks.fault_type_id = fault_types.id))) LEFT JOIN contact_types ON ((tasks.contact_type_id = contact_types.id))) LEFT JOIN users ON ((tasks.user_id = users.id))) LEFT JOIN payers ON ((tasks.payer_id = payers.id))) WHERE (((claims.paid)::text = 'Not Paid'::text) AND (tasks.followup_date < now())) ORDER BY tasks.followup_date;


ALTER TABLE public.claims_requiring_followup OWNER TO dev;

--
-- Name: claims_without_action; Type: VIEW; Schema: public; Owner: dev
--

CREATE VIEW claims_without_action AS
    SELECT patients.id, patients.patient_last_name, patients.patient_first_name, patients.patient_mi, patients.patient_birth_date, claims.first_claim_date, claims.total_charge, claims.balance_due, claims.id AS claim_id FROM (claims LEFT JOIN patients ON ((claims.patient_id = patients.id))) WHERE ((claims.last_action_id IS NULL) AND ((claims.paid)::text = 'Not Paid'::text)) ORDER BY claims.first_claim_date;


